    lerp(args) {
      let a = Scratch.Cast.toNumber(args.A);
      let b = Scratch.Cast.toNumber(args.B);
      let n = Scratch.Cast.toNumber(args.N);
      return (n * (b - a)) + a;
    }
    inverselerp(args) {
      let a = Scratch.Cast.toNumber(args.A);
      let b = Scratch.Cast.toNumber(args.B);
      let n = Scratch.Cast.toNumber(args.N);
      return (n - a) / (b - a);
    }
    doublelerp(args) {
      let a = Scratch.Cast.toNumber(args.A);
      let b = Scratch.Cast.toNumber(args.B);
      let c = Scratch.Cast.toNumber(args.C);
      let d = Scratch.Cast.toNumber(args.D);
      let n = Scratch.Cast.toNumber(args.N);
      return (((n - c) / (d - c)) * (b - a)) + a;
    }
